import '../styles/Home.css';
import React from 'react';
import pic from './nuwc.jpg'

function Home() {
  return (
    <div className='header' styles={{ backgroundImage:`url(${PIC})` }}>
        <p><strong>Welcome to NavTask!</strong></p>
        
    </div>
  );
}

export default Home;
